export default function SelectList(props) {
	return (
		<div className="loc-wrapper">
			<Dropdow placeholder="languages">
				<option value="" disabled selected hidden>{props.title}</option>
				{props.options.map(options => (
					<option value="">{options.text}</option>
				))}
				<option value="">Abudhabi</option>
				<option value="">Al Ain</option>
				<option value="">Dubai</option>
				<option value="">Fujairah</option>
				<option value="">Ras al Khaima</option>
				<option value="">Sharjah</option>
				<option value="">Ajman</option>
			</Dropdow>
			<DownOutlined className='dropdown-icon' />
		</div>
	);
}
